  true,\n\t\"url\": null,\n\t\"notes\": \"MODIS (or Moderate Resolution Imaging Spectroradiometer)
  is a key instrument aboard thenTerra (EOS AM) and Aqua (EOS PM) satellites. Terra's
  orbit around the Earth is timed sonthat it passes from north to south across the
  equator in the morning, while Aqua passesnsouth to north over the equator in the
  afternoon. Terra MODIS and Aqua MODIS are viewingnthe entire Earth's surface every
  1 to 2 days, acquiring data in 36 spectral bands, orngroups of wavelengths (see
  MODIS Technical Specifications). These data will improve ournunderstanding of global
  dynamics and processes occurring on the land, in the oceans,nand in the lower atmosphere.
  MODIS is playing a vital role in the development ofnvalidated, global, interactive
  Earth system models able to predict global changenaccurately enough to assist policy
  makers in making sound decisions concerning thenprotection of our environment.\",\n\t\"license_title\":
